import React from "react";
import styled from "styled-components";

const HomeTitle = () => {
  return (
    <Wrapper>
      <div className="title">홈</div>
      <div className="button-container">
        <button className="btn-others">
          다음 유저의 북마크 보기
        </button>
      </div>
    </Wrapper>
  );
};

export default HomeTitle;

const Wrapper = styled.div`
  display: flex;
  justify-content: space-between;
  padding-left: 170px;
  padding-right: 170px;
  align-items: center;

  .title {
    color: #212529;
    font-size: 32px;
    font-family: 'Pret-Bold';
    font-weight: 700;
    line-height: 46px;
    word-wrap: break-word;
  }

  .button-container {
    display: flex;
    align-items: center;
  }

  .btn-others {
    width: 224px;
    height: 100%;
    padding: 16px 24px;
    background: white;
    border-radius: 14px;
    border: 1px #7749F8 solid;
    display: inline-flex;
    color: #6610F2;
    font-size: 16px;
    font-family: 'Pret-Bold';
    font-weight: 700;
    line-height: 24px;
    word-wrap: break-word;
  }
`;
